// AppointmentList.js
import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { format, parseISO } from 'date-fns';
import { BarChart, Bar, XAxis, YAxis, Tooltip, CartesianGrid } from 'recharts';
import { Card, CardHeader, CardTitle, CardContent } from '@/components/ui/card';


const AppointmentList = () => {
  const [appointments, setAppointments] = useState([]);

  useEffect(() => {
    fetchAppointments();
  }, []);

  const fetchAppointments = async () => {
    try {
      const response = await fetch('http://localhost:3000/api/appointments', {
        headers: {
          'Authorization': `Bearer ${localStorage.getItem('token')}`
        }
      });
      const data = await response.json();
      setAppointments(data);
    } catch (error) {
      console.error('Error fetching appointments:', error);
    }
  };

  const handleCancel = async (id) => {
    try {
      const response = await fetch(`http://localhost:3000/api/appointments/${id}`, {
        method: 'DELETE',
        headers: {
          'Authorization': `Bearer ${localStorage.getItem('token')}`
        }
      });

      if (response.ok) {
        fetchAppointments();
      }
    } catch (error) {
      console.error('Error canceling appointment:', error);
    }
  };

  return (
    <div className="max-w-4xl mx-auto mt-8">
      <h2 className="text-2xl font-bold mb-6">My Appointments</h2>
      <div className="grid gap-4">
        {appointments.map(appointment => (
          <div key={appointment.id} className="p-4 border rounded shadow-sm">
            <div className="flex justify-between items-center">
              <div>
                <p className="font-bold">
                  {format(new Date(appointment.date), 'MMMM d, yyyy')}
                </p>                                                      
                <p className="text-gray-600">{appointment.time}</p>
                {appointment.notes && (
                  <p className="text-gray-500 mt-2">{appointment.notes}</p>
                )}
              </div>
              <button
                onClick={() => handleCancel(appointment.id)}
                className="bg-red-500 text-white px-4 py-2 rounded hover:bg-red-600"
              >
                Cancel
              </button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}; 

const AdminPanel = () => {
  const [appointments, setAppointments] = useState([]);
  const [filteredAppointments, setFilteredAppointments] = useState([]);
  const [searchTerm, setSearchTerm] = useState('');
  const [dailyStats, setDailyStats] = useState([]);
  const [errorMessage, setErrorMessage] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (!token) {
      navigate('/login');
    } else {
      fetchAppointments();
    }
  }, [navigate]);

  const fetchAppointments = async () => {
    try {
      const token = localStorage.getItem('token');
      const response = await fetch('http://localhost:3000/api/admin/appointments', {
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json'
        },
      });

      if (response.status === 403) {
        navigate('/dashboard');
        return;
      }

      if (!response.ok) throw new Error('Failed to fetch appointments');

      const data = await response.json();
      setAppointments(data);
      setFilteredAppointments(data);
      
      // Process data for daily stats
      const stats = data.reduce((acc, curr) => {
        const date = curr.date;
        acc[date] = (acc[date] || 0) + 1;
        return acc;
      }, {});
      
      const statsArray = Object.entries(stats).map(([date, count]) => ({
        date: format(parseISO(date), 'MMM dd'),
        appointments: count
      }));
      
      setDailyStats(statsArray);
    } catch (error) {
      setErrorMessage('Failed to fetch appointments');
    }
  };

  useEffect(() => {
    const filtered = appointments.filter((appointment) =>
      appointment.userName?.toLowerCase().includes(searchTerm.toLowerCase()) ||
      appointment.userEmail?.toLowerCase().includes(searchTerm.toLowerCase())
    );
    setFilteredAppointments(filtered);
  }, [searchTerm, appointments]);

  return (
    <div className="max-w-7xl mx-auto mt-8 space-y-6">
      <Card>
        <CardHeader>
          <CardTitle>Daily Appointments Overview</CardTitle>
        </CardHeader>
        <CardContent>
          <div className="h-64">
            <BarChart width={800} height={250} data={dailyStats}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="date" />
              <YAxis />
              <Tooltip />
              <Bar dataKey="appointments" fill="#3b82f6" />
            </BarChart>
          </div>
        </CardContent>
      </Card>

      <Card>
        <CardHeader>
          <CardTitle>Appointments List</CardTitle>
        </CardHeader>
        <CardContent>
          {errorMessage && (
            <div className="mb-4 p-2 bg-red-100 text-red-600 rounded">
              {errorMessage}
            </div>
          )}

          <input
            type="text"
            placeholder="Search by user name or email..."
            className="w-full p-2 border rounded mb-6"
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
          />

          <div className="overflow-x-auto">
            <table className="min-w-full bg-white border">
              <thead>
                <tr>
                  <th className="px-6 py-3 border-b-2 border-gray-300 text-left font-semibold">Date</th>
                  <th className="px-6 py-3 border-b-2 border-gray-300 text-left font-semibold">Time</th>
                  <th className="px-6 py-3 border-b-2 border-gray-300 text-left font-semibold">User</th>
                  <th className="px-6 py-3 border-b-2 border-gray-300 text-left font-semibold">Contact</th>
                  <th className="px-6 py-3 border-b-2 border-gray-300 text-left font-semibold">Notes</th>
                </tr>
              </thead>
              <tbody>
                {filteredAppointments.map((appointment) => (
                  <tr key={appointment.id} className="hover:bg-gray-50">
                    <td className="px-6 py-4 border-b">{format(parseISO(appointment.date), 'MMMM d, yyyy')}</td>
                    <td className="px-6 py-4 border-b">{appointment.time}</td>
                    <td className="px-6 py-4 border-b">{appointment.user_name}</td>
                    <td className="px-6 py-4 border-b">{appointment.contact}</td>
                    <td className="px-6 py-4 border-b">{appointment.notes}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </CardContent>
      </Card>
    </div>
  );
};


export { AppointmentList, AdminPanel };
